Het verhaal over twee politieagenten (Bruce Willis en Tracy Morgan) 
die verwikkeld raken in verschillende avonturen. Zo zijn ze op zoek 
naar een gestolen - en zeer zeldzame - baseballkaart, proberen ze een 
mooie Mexicaanse vrouw te redden en krijgen ze ook nog eens te maken 
met een groep gangsters, die geld proberen te witwassen.
